import React from 'react'
import Button from '@material-ui/core/Button';
import AddIcon from '@material-ui/icons/Add';


const Todo = ()=> {
    return( 
    <>
        <div className='main_div'>
            <div className="center_div">
                <br/>
                <h1> ToDo List</h1>
                <br/>
                <input type='text'
                placeholder="Add items"></input>
                <Button>
                    <AddIcon></AddIcon>
                </Button>
            </div>
        </div>
    </>
    );
};
export default Todo;
